import logo from './grupo3.png';
import './App.css';

function App() {
  return (
    <body>
      <main>

            <form>
              <img src={logo}></img>
              <input type="text" placeholder='Usuario' ></input>
              <input type="text" placeholder='Senha' ></input>
            </form>

      </main>
    </body>
  );
}

export default App;
